import React from "react";
import Note from "./Note";

function createNote(note) {
    return <Note 
        h={note.h}
        p={note.p}
        imgURL={note.imgURL}
    />
}

function Notes() {
  return (
    <div>
      <Note h="Wow" p="For real" imgURL="https://images.unsplash.com/photo-1504210288106-e478b8da3919?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1170&q=80"/>
      <Note h="Nice" p="This is crazy" />
      <Note h="Gomamon" p="Yes, gomamon" />
    </div>
  );
}

export default Notes;
